function configsubmitForm(){var a={"configName":$("#configName_add").val(),"configKey":$("#configKey_add").val(),"configValue":$("#configValue_add").val(),"description":$("#description_add").val()};console.log(a);if(a.configName==""){$.messager.alert("提示","配置项名称不能为空");return}if(a.configKey==""){$.messager.alert("提示","配置项代码不能为空");return}if(a.configValue==""){$.messager.alert("提示","配置项值不能为空");return}$.ajax({url:ws_url+"/rest/Sysconfig/insertConfig?token="+gtoken,contentType:"application/json;charset=UTF-8",type:"post",datatype:"json",data:JSON.stringify(a),cache:false,success:function(b){console.log(b.status);console.log(b.message);$("#form1").form("clear");if(b.status=="success"){$.messager.alert("提示","添加成功！","info",function(){$("#configadd").window("close");$("#configgrid").datagrid("reload")})}else{if(b.status=="failure"){if(b.message=="Configuration.Exists.Success"){$.messager.alert("提示","数据已经存在,添加失败！","warning",function(){$("#configadd").window("close");$("#configgrid").datagrid("reload")})}else{$.messager.alert("提示","添加失败！","error",function(){$("#configadd").window("close");$("#configgrid").datagrid("reload")})}}}},error:function(b){console.log(b)}})};